import React from 'react';
import { ReactComponent as img } from './cookie.jpg';

class cookieButton extends React.Component {
    render() {
        return (
            <div className="Cookie">
                <img src={require('./cookie.jpg')} alt="Cookie Img" />
            </div>
        );
    }
}

export default cookieButton;
